import React from 'react';
import { useState, useEffect } from 'react';
import { Search, File, Mail, MessageSquare, Github, BookOpen } from 'lucide-react';
import type { SearchResult } from '../types';

const mockSearch = async (query: string): Promise<SearchResult[]> => {
  await new Promise(resolve => setTimeout(resolve, 1000)); // Simulate API delay
  return [
    { id: '1', title: 'Q4 Financial Report', snippet: 'The Q4 financial report shows a 15% increase in revenue...', source: 'Document', date: '2023-12-15' },
    { id: '2', title: 'Team Meeting Notes', snippet: 'Discussed the new product launch timeline and marketing strategy...', source: 'Email', date: '2023-12-10' },
    { id: '3', title: 'New Feature Discussion', snippet: 'The team agreed on implementing the new search functionality...', source: 'Slack', date: '2023-12-05' },
    { id: '4', title: 'Bug Fix: Search Pagination', snippet: 'Fixed an issue with search results pagination on mobile devices...', source: 'GitHub', date: '2023-12-01' },
    { id: '5', title: 'Product Roadmap 2024', snippet: 'Outlined the key features and improvements planned for Q1 and Q2...', source: 'Notion', date: '2023-11-28' },
  ];
};

const sourceIcons: { [key: string]: React.ElementType } = {
  Document: File,
  Email: Mail,
  Slack: MessageSquare,
  GitHub: Github,
  Notion: BookOpen,
};

export default function DemoSection() {
  const [searchTerm, setSearchTerm] = useState('');
  const [searchResults, setSearchResults] = useState<SearchResult[]>([]);
  const [isLoading, setIsLoading] = useState(false);

  const handleSearch = async (e: React.FormEvent) => {
    e.preventDefault();
    setIsLoading(true);
    const results = await mockSearch(searchTerm);
    setSearchResults(results);
    setIsLoading(false);
  };

  return (
    <section id="demo" className="bg-white dark:bg-gray-900 py-20">
      <div className="mx-auto max-w-6xl px-4">
        <h2 className="mb-12 text-center text-4xl font-bold text-gray-900 dark:text-white">See it in action</h2>
        <div className="rounded-lg bg-gray-100 dark:bg-gray-800 p-8 shadow-lg">
          <form onSubmit={handleSearch} className="mb-8">
            <div className="relative">
              <input
                type="text"
                value={searchTerm}
                onChange={(e) => setSearchTerm(e.target.value)}
                placeholder="Try searching for 'financial report' or 'meeting notes'..."
                className="w-full rounded-lg bg-white dark:bg-gray-700 px-4 py-3 pl-12 text-gray-900 dark:text-white placeholder-gray-500 dark:placeholder-gray-400 shadow-md focus:outline-none focus:ring-2 focus:ring-purple-500"
              />
              <Search className="absolute left-4 top-1/2 h-5 w-5 -translate-y-1/2 text-gray-400" />
            </div>
            <button
              type="submit"
              className="mt-4 rounded-lg bg-purple-600 px-8 py-3 font-semibold text-white hover:bg-purple-700 focus:outline-none focus:ring-2 focus:ring-purple-500 focus:ring-offset-2 transition duration-300 transform hover:scale-105"
              disabled={isLoading}
            >
              {isLoading ? 'Searching...' : 'Search'}
            </button>
          </form>
          {searchResults.length > 0 && (
            <div>
              <h3 className="mb-4 text-xl font-semibold text-gray-900 dark:text-white">Search Results</h3>
              <ul className="space-y-4">
                {searchResults.map((result) => {
                  const IconComponent = sourceIcons[result.source] || File;
                  return (
                    <li key={result.id} className="rounded-lg bg-white dark:bg-gray-700 p-4 shadow-md transition duration-300 hover:shadow-lg">
                      <div className="flex items-center mb-2">
                        <IconComponent className="h-5 w-5 mr-2 text-purple-600 dark:text-purple-400" />
                        <h4 className="text-lg font-semibold text-gray-900 dark:text-white">{result.title}</h4>
                      </div>
                      <p className="text-gray-600 dark:text-gray-300 mb-2">{result.snippet}</p>
                      <div className="flex justify-between text-sm text-gray-500 dark:text-gray-400">
                        <span>{result.source}</span>
                        <span>{result.date}</span>
                      </div>
                    </li>
                  );
                })}
              </ul>
            </div>
          )}
        </div>
      </div>
    </section>
  );
}
